            'Store and access 1tb of photos and files on the go with slimmer backup, a portable external hard drive\nThis portable hard drive features a minimalist metal enclosure, and is an elegant usb drive\nSimply plug this portable hard drive into a windows or mac computer via the included usb 3.0 cable to back up files with a single click or schedule automatic daily, weekly or monthly backup. Reformatting may be required for use with the time machine.\nEnjoy a complimentary two-month membership to the Adobe Creative Cloud Photography plan for access to amazing photo and video editing apps\nEnjoy long-term peace of mind with the included two-year limited term\nAbout capacity:\nSince the calculation units of hard drive manufacturers and computer operating systems are different, the capacity display will be different. When producing hard disks, the capacity is calculated according to 1g = 1000m = 1000*1000k = 1000*1000*1000byte. However, the computer operating system is binary and calculated according to 1g = 1024m = 1024*1024k = 1024*1024*1024byte.\nFor example, the actual capacity is the marked capacity of the hard disk 1000g/1024 / 1,024 / 1,024 = 931g (1000 ÷ 1,024 ÷ 1,024 ÷ 1,024), so the display capacity of a 1tb hard disk is 931g.\nEasy and simple to use-plug it in and go.\nFast file transfers with superspeed usb 3.0.\nCompatible with usb 3.0 and usb 2.0.\nJust plug in the included power supply and usb cable.\nAutomatically recognized by the windows operating system so there is no software to install or configure needed.\nDrag and drop the recording from the file out of the box.\nBuilt-in power management ensures energy-saving operation.\nPlease note: the product needs to be reformatted if it is to be used with mac. Reformatting the drive will erase all content unless it is supported for another drive.\nFAQ:\nThe solution for booting from hard drives beyond 2.2tb.\nMost legacy systems built before 2011 have a traditional computer bios. This type of bios uses a master boot record (mbr). Mbr partitions can define a disk drive capacity up to 2.2tb. Windows operating systems that boot from one mbr are therefore limited to 2.2tb per mbr. As a 3tb disk drive in a legacy bios and window system it will need a discwizard device driver to access the full capacity of a 3tb disk drive. Two partitions will be needed because of the mbr limitation. The device driver mounts capacity above 2.2tb with another mbr that looks at the system as a second virtual "physical" device.\nguid partition tables (gpt) can define drives larger than 2.2tb. You can use gpt today on any windows 10/8.1/8/7 and vista system as a non-boot data drive. Windows can only boot a gpt partition in a new type of bios called uefi.\n\n• Capacity: 1TB/2TB/500G\n• Interface: USB 3.0\n• Backup: Auto and Cloud backup\n• Quick file transfer with USB 3.0 connectivity\n• USB powered - no power supply necessary\n• Create easy customized backup plans with included Seagate Dashboard software\n• System Requirements: Windows 10, Windows',
